def icocb(app):
    temp = open('temp.ico', 'wb+')  # icon
    tempb64 = base64.b64decode(icop)  # base64
    temp.write(tempb64)  # 
    temp.close()
    app.iconbitmap('temp.ico')  # exeicon
    remove('temp.ico')  # 


